import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the login form
    await page.waitForSelector('#email');
    await page.fill('#email', 'test@example.com'); // Replace with actual email
    await page.waitForSelector('#password');
    await page.fill('#password', 'password123'); // Replace with actual password

    // Click the login button
    await page.waitForSelector('button.login-btn');
    await page.click('button.login-btn');

    // Wait for navigation or response after login
    await page.waitForLoadState('networkidle');

    // Take a screenshot after login attempt
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Check for success or failure
    const errorMessageVisible = await page.isVisible('#errorMessage');
    if (errorMessageVisible) {
      const errorMessage = await page.textContent('#errorMessage');
      return {
        success: false,
        action: "Login attempt failed",
        extractedData: { errorMessage },
        screenshots,
        error: null
      };
    }

    return {
      success: true,
      action: "Successfully logged in",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

