import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('#email');

    // Fill in the login form
    await page.fill('#email', 'user@example.com'); // Use ID selector for email field
    await page.fill('#password', 'yourpassword'); // Use ID selector for password field

    // Click the login button
    await page.click('button.login-btn'); // Use class selector for login button

    // Wait for navigation after login
    await page.waitForLoadState('networkidle');

    // Take a screenshot after logging in
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Verify successful login by checking for an element that is only visible when logged in
    const isLoggedIn = await page.isVisible('text=Home'); // Change selector to something that appears on the home page

    return {
      success: isLoggedIn,
      action: isLoggedIn ? "Logged in successfully" : "Login failed",
      extractedData: { loggedIn: isLoggedIn },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
